import React, { useState, useEffect } from 'react';
import { io } from 'socket.io-client';
import { Client, Intents } from 'discord.js';

type ContactPageProps = {
  isDark: boolean;
};

const ContactPage: React.FC<ContactPageProps> = ({ isDark }) => {
  const [message, setMessage] = useState('');
  const [messages, setMessages] = useState<string[]>([]);
  const socket = io('http://localhost:4000'); // replace the URL with your server address

  const client = new Client({ 
    intents: [Intents.FLAGS.GUILDS, Intents.FLAGS.GUILD_MESSAGES],
    presence: {
      status: 'online',
      activities: [{ name: 'with React' }],
    },
    restTimeOffset: 0,
    retryLimit: 3,
    failIfNotExists: false,
    restWsBridgeTimeout: 5000,
    restRequestTimeout: 15000,
    partials: ['MESSAGE', 'CHANNEL', 'REACTION'],
    allowedMentions: {
      parse: ['users', 'roles'],
      repliedUser: true,
    },
    restSweepInterval: 300,
    restRetries: 2,
    messageLimit: 0,
    messageCacheLifetime: 0,
    messageCacheMaxSize: 0,
    restGlobalRateLimit: true,
    presenceUpdateInterval: 0,
    guildCreateTimeout: 5000,
    http: {
      version: 7,
      api: 'https://discord.com/api',
      cdn: 'https://cdn.discordapp.com',
      invite: 'https://discord.gg',
    },
    retryOnLimit: true,
    maxShards: 'auto',
    shardCount: 1,
    shardId: 0,
    ws: {
      intents: [Intents.FLAGS.GUILDS, Intents.FLAGS.GUILD_MESSAGES],
    },
    token: 'YOUR_DISCORD_BOT_TOKEN',
  });
  const channelID = 'YOUR_CHANNEL_ID'; // replace with your channel ID

  useEffect(() => {
    console.log('Connecting to Discord...');

    client.on('ready', () => {
      console.log(`Logged in as ${client.user?.tag}!`);
    });

    client.on('messageCreate', (discordMessage) => {
      setMessages((messages) => [
        ...messages,
        `[Discord] ${discordMessage.author?.tag}: ${discordMessage.content}`,
      ]);
    });

    client.login('YOUR_DISCORD_BOT_TOKEN');

    return () => {
      console.log('Disconnecting from Discord...');
      client.destroy();
    };
  }, []);

  const handleSendMessage = async (msg: string) => {
    try {
      const channel = await client.channels.fetch(channelID);
      if (channel?.isText()) {
        await channel.send(msg);
      } else {
        console.error('Invalid channel!');
      }
    } catch (err) {
      console.error(err);
    }
  };

  const handleSubmit = (event: React.FormEvent) => {
    event.preventDefault();
    if (message.trim() !== '') {
      socket.emit('message', message);
      handleSendMessage(message);
      setMessage('');
    }
  };

  return (
    <div>
      <div
        className="main2"
        style={{
          backgroundImage: isDark
            ? 'radial-gradient(#ffffff 1px, #000000 1px)'
            : 'radial-gradient(#000000 1px, #ffffff 1px)',
        }}
      >
        <table
          className="contact_form"
          style={{
            backgroundColor: isDark ? '#000' : '#fff',
            border: isDark ? '1px solid white' : '1px solid black',
          }}
        >
          <tbody>
            <tr>
              <td>
                <br />
                <input
                  style={{
                    backgroundColor: isDark ? '#000' : '#fff',
                    color: isDark ? '#fff' : '#000',
                    borderBottom: isDark ? '1px solid white' : '1px solid black',
                  }}
                  type="text"
                  placeholder="Name"
                />
              </td>
            </tr>
            <tr>
              <td>
                <input
                  style={{
                    backgroundColor: isDark ? '#000' : '#fff',
                    color: isDark ? '#fff' : '#000',
                    borderBottom: isDark ? '1px solid white' : '1px solid black',
                  }}
                  type="email"
                  placeholder="Email"
                />
              </td>
            </tr>
            <tr>
              <td>
                <textarea
                  style={{
                    backgroundColor: isDark? '#000' : '#fff', color: isDark ? '#fff' : '#000', borderBottom: isDark ? '1px solid white' : '1px solid black', }} value={message} onChange={(e) => setMessage(e.target.value)} placeholder="Message" ></textarea> </td> </tr> <tr> <td> <button onClick={handleSubmit} style={{ backgroundColor: isDark ? '#fff' : '#000', color: isDark ? '#000' : '#fff', }} > Contact Us </button> <br /> </td> </tr> {messages.map((message, index) => ( <tr key={index}> <td>{message}</td> </tr> ))} </tbody> </table> </div> </div> ); };

                    export default ContactPage;
